import React from 'react';
import './Footer.css';
// import lineWhite from '../icons/Line-white.svg';

function Footer() {
  return (
  <>
     <div className='footer'>
        <div className='footer-container'>
            <div className='footer-leftside-container'>
                <div className="fotter-leftside-line"></div>
                <p className='fotter-leftside-title'>ENDEREÇOS</p>                
            </div>

            <div className='footer-rightside-container'>

            </div>
        </div>
    </div>
  </>
  );
}

export default Footer;
